  render() {
    return (  
     <nav className="navbar navbar-expand-sm  bg-primary">
       <Link to='/'>

       </Link>
      <Link to='/cart' className="ml-auto">
        <button>
          Cart
        </button>
      </Link>

      </nav>
    );
  }
}

export default Navbar;
